The type system of Rust doesn't allow the programmer to formalize the assumption that square expects a small u8. This becomes possible using hax: one can annotate a function with a pre-condition on its inputs. The pre-conditions and post-conditions on a function form a contract : "if you give me some inputs that satisfies a given formula ( the precondition ), I will produce a return value that satisfy another formula ( the postcondition )". Outside this contracts, anything might happen: the function might panic, might run forever, erase your disk, or anything. The helper crate hax-lib provdes the requires proc-macro which lets user writting pre-conditions directly in Rust. #[hax_lib::requires(x < 16)]
fn square_requires(x: u8) -> u8 { x * x
} With this precondition, F* is able to prove panic freedom. From now on, it is the responsibility of the clients of square to respect the contact. The next step is thus be to verify, through hax extraction, that square is used correctly at every call site.

