While the correctness of square is obvious, the Barrett reduction is not. Given value a field element (a i32 whose absolute value is at most BARRET_R), the function barrett_reduce defined below computes result such that: result ≡ value (mod FIELD_MODULUS); the absolute value of result is bound as follows: |result| < FIELD_MODULUS. It is easy to write this contract directly as hax::requires and hax::ensures annotations, as shown in the snippet below. type FieldElement = i32;
const FIELD_MODULUS: i32 = 3329;
const BARRETT_SHIFT: i64 = 26;
const BARRETT_R: i64 = 0x4000000; // 2^26
const BARRETT_MULTIPLIER: i64 = 20159; // ⌊(BARRETT_R / FIELD_MODULUS) + 1/2⌋ #[hax_lib::requires((i64::from(value) >= -BARRETT_R && i64::from(value) <= BARRETT_R))]
#[hax_lib::ensures(|result| result > -FIELD_MODULUS && result < FIELD_MODULUS && result % FIELD_MODULUS == value % FIELD_MODULUS)]
fn barrett_reduce(value: i32) -> i32 { let t = i64::from(value) * BARRETT_MULTIPLIER; let t = t + (BARRETT_R >> 1); let quotient = t >> BARRETT_SHIFT; let quotient = quotient as i32; let sub = quotient * FIELD_MODULUS; // Here a lemma to prove that `(quotient * 3329) % 3329 = 0` // may have to be called in F*. value - sub
} Before returning, a lemma may have to be called in F* to prove the correctness of the reduction. The lemma is Math.Lemmas.cancel_mul_mod (v quotient) 3329;, which establishes that (quotient * 3329) % 3329 is zero. With the help of that one lemma, F* is able to prove the reduction computes the expected result. (We may expose lemmas like this to call from Rust directly in future.) This Barrett reduction examples is taken from libcrux 's proof of Kyber which is using hax and F*. This example showcases an intrinsic proof : the function barrett_reduce not only computes a value, but it also ship a proof that the post-condition holds. The pre-condition and post-condition gives the function a formal specification, which is useful both for further formal verification and for documentation purposes.

