Consider the encrypt and decrypt functions below. Those functions have no precondition, don't have particularly interesting properties individually. However, the composition of the two yields an useful property: encrypting a ciphertext and decrypting the result with a same key produces the ciphertext again. |c| decrypt(c, key) is the inverse of |p| encrypt(p, key). fn encrypt(plaintext: u32, key: u32) -> u32 { plaintext ^ key
} fn decrypt(ciphertext: u32, key: u32) -> u32 { ciphertext ^ key
} In this situation, adding a pre- or a post-condition to either encrypt or decrypt is not useful: we want to state our inverse property about both of them. Better, we want this property to be stated directly in Rust: just as with pre and post-conditions, the Rust souces should clearly state what is to be proven. To this end, Hax provides a macro lemma. Below, the Rust function encrypt_decrypt_identity takes a key and a plaintext, and then states the inverse property. The body is empty: the details of the proof itself are not relevant, at this stage, we only care about the statement. The proof will be completed manually in the proof assistant. # fn encrypt(plaintext: u32, key: u32) -> u32 {
# plaintext ^ key
# }
# # fn decrypt(ciphertext: u32, key: u32) -> u32 {
# ciphertext ^ key
# }
# #[hax_lib::lemma]
#[hax_lib::requires(true)]
fn encrypt_decrypt_identity( key: u32, plaintext: u32,
) -> Proof<{ decrypt(encrypt(plaintext, key), key) == plaintext }> {
}

